import React, {useState, useEffect} from 'react';
import "./SwapButton.css"

export default function SwapButton(props) {
    console.log(props)
    const switchTab = () => {
        props.data.setCurrTab(prevState => {
            return prevState === "stats" ? "listings" : "stats"
        })
    }

    return (
        <button className='swapButton' onClick={switchTab}>
            Search Housing in this Area
        </button>
    )
}
